http://www.w3.org/2000/01/rdf-schema#com.value:
Un fluido refrigerante (o semplicemente refrigerante) ha il compito di trasferire in modo ottimale il calore da una sorgente calda ad una sorgente fredda. Il trasferimento di energia può avvenire mediante scambio di calore latente (evaporazione, condensazione) e/o mediante scambio di calore sensibile (riscaldamento, raffreddamento). È opportuno che il refrigerante possieda: 
*  elevata densità, sia allo stato gassoso che liquido; 
*  elevata entalpia di evaporazione; 
*  elevata capacità termica; 
*  elevata stabilità nelle condizioni di utilizzo.

